import './App.css';
import React, {useState} from 'react';
import Header from "./Components/Header/Header.js";
import OptionsBar, {button} from "./Components/OptionsBar/OptionsBar.js";
import HomeScreen from "./Containers/HomeScreen/HomeScreen.js";
import headshot from './Assets/Headshot.png';

function App() {

  return (
    <div className="App">
      <Header />
      <OptionsBar />
      <div>{OptionsBar.buttonClicked}</div>
      {button == 1 ?
      <HomeScreen />
      : <div> test </div>}
      {button}
    </div>

  );
}

export default App;
